*
 * Map an integer value to a word list, with optional offset.
 * @type {Quality}
 * @example
 * {
 *    initialValue: 0,  // a number
 *    words: ['bad', 'ok', 'good'],
 *    offset: 0  // rendered text = words[value + offset]
 * }

